import * as React from 'react';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import dayjs, {Dayjs} from 'dayjs';
import { DataGrid, GridColDef, GridValueGetterParams } from '@mui/x-data-grid';


const columns: GridColDef[] = [
  { field: 'id', headerName: 'ID', width: 70 },
  { field: 'bugTitle', headerName: 'Bug Title', width: 130 },
  { field: 'lastName', headerName: 'Last name', width: 130 },
  {
    field: 'age',
    headerName: 'Age',
    type: 'number',
    width: 90,
  },
  {
    field: 'fullName',
    headerName: 'Full name',
    description: 'This column has a value getter and is not sortable.',
    sortable: false,
    width: 160,
    valueGetter: (params: GridValueGetterParams) =>
      `${params.row.bugTitle || ''} ${params.row.lastName || ''}`,
  },
];

const rows = [
  { id: 1, lastName: 'Snow', bugTitle: 'Jon', age: 35 },
  { id: 2, lastName: 'Lannister', bugTitle: 'Cersei', age: 42 },
  { id: 3, lastName: 'Lannister', bugTitle: 'Jaime', age: 45 },
  { id: 4, lastName: 'Stark', bugTitle: 'Arya', age: 16 },
  { id: 5, lastName: 'Targaryen', bugTitle: 'Daenerys', age: null },
  { id: 6, lastName: 'Melisandre', bugTitle: null, age: 150 },
  { id: 7, lastName: 'Clifford', bugTitle: 'Ferrara', age: 44 },
  { id: 8, lastName: 'Frances', bugTitle: 'Rossini', age: 36 },
  { id: 9, lastName: 'Roxie', bugTitle: 'Harvey', age: 65 },
];

export default function DataTable() {
  return (
    <div style={{ height: 400, width: '100%' }}>
      <DataGrid
        rows={rows}
        columns={columns}
        pageSize={5}
        rowsPerPageOptions={[5]}
        checkboxSelection
      />
    </div>
  );
}
